import React from "react";
import "./App.css";
import Container from "./components/ContainerBlock/Container";
import { BrowserRouter, Route } from "react-router-dom";
import NAserver from "./Pages/NAserver/NAserver";
import Title from "./components/Title/Title";
import NavBar from "./components/Navbar/NavBarBlock";
import BodyBlock from "./components/Body/BodyBlock";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <div className="container">
          <Title />
          <NavBar />
          <BodyBlock />
          <Route path="/" component={Container} />
          <Route path="/NAServer" component={NAserver} />
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
